import React, { Component } from 'react';
import { Link } from "react-router-dom";
import Header from "../header";
import Footer from "../footer";
import { Container, Row , Col , Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle, Button } from "reactstrap";
  import { Form, FormGroup, Label, Input, FormText } from 'reactstrap';
  import { faEnvelope, faArrowRight } from "@fortawesome/free-solid-svg-icons";
  import { faArrowLeft } from "@fortawesome/free-solid-svg-icons";
  import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";



class Contact extends Component {

  render(){
    if(window.innerWidth < 760){
       console.log(window.innerWidth)
    }

    let show = {
      display:"block"
     };
     let hide = {
       display:"block"
      };
    return (
        <div>
            <React.Fragment>
                <Header />
                <Container>
                  <div  className="contactpage">
                    <Row>
                    <Col style={show} id="contacttext" md="6" sm="12"><div className="contacttext">
                    <Button onClick={this.hide}   className="button"><FontAwesomeIcon icon={faEnvelope} />  </Button>
                      <h1>تواصل معنا</h1>
                      <br/>
                      <br/>
                      
                      <p>ارسل الينا ما تود طرحه من مشاكل 
                        او اقتراحات وسوف نري ما نستطيع 
                              إن نساعدك به 
                       </p>
                      <br/>
                      <br/>
                      <br/>
                      <p>نتمنى لك تجربة سعيدة </p>
                     
                      </div></Col>

                    
                    <Col style={hide} md="6" sm="12">
                    <div className="formcontact">
                      <Form>
                        <FormGroup>
                        <Label >الاسم</Label>
                          <Input type="email" name="email"  placeholder="" />
                        </FormGroup>
                        <FormGroup>
                        <Label >البريد الاكتروني</Label>
                          <Input type="email" name="email"  placeholder="" />
                        </FormGroup>
                        <FormGroup>
                        <Label for="exampleText">الرساله</Label>
                        <Input type="textarea" name="text" id="exampleText" />
                        </FormGroup>
                        <Button>ارسال {" "} <FontAwesomeIcon icon={faEnvelope} /></Button>
                      </Form>
                      <Button   className="button"><FontAwesomeIcon icon={faArrowLeft} />  </Button>

                    </div>
                    
                    </Col>
                    </Row>
                  </div>
              </Container>
              <Footer />
            </React.Fragment>
            
        </div>
    )
  }
}

export default Contact;
